import React, { useState, useEffect } from 'react';

export default function Login() {

  useEffect(() => {
      document.title = "Login";
  }, [])

  return (
    <div className='login'>
      <form className='login__form'>
        <h1> Login </h1>
      </form>
    </div>
  );
}
